@terrysimmonsjr and I go way back to when I relaunched Chimes Boutique in 2017. From our very first meeting he “got me”. Not only did he “get me”, he was also up for the challenge of DELIVERING at the level I require. Before y’all look at me sideways, understand that I am the first to admit that’s not always an easy thing to do 😅 and I hold myself to the same high standards I require... but this post is about Terry, so back to him 😝. From our first meeting he made it his business to understand me, my why, my goals, how I think, move, and behave. You will often see him comment “behave 🧩” on my posts when I get to being extra spicy he tries, unsuccessfully, to reel me in 😆. 

Over the years we have teamed up on a number of projects and they have all served to grow my brand as well as myself, personally. I respect the body of work he has produced and the way he and his team consistently execute for his clients. As you can see in the pictures below, it’s more than just business. We cut up from time to time because I love to laugh and have a good time, but at the end of the day, it’s all a brother/sister relationship with mutual love and respect for each other’s skills, talents, work acumen, and more than anything Terry is dedicated to seeing his clients WIN 🏆! 

Congratulations to you and your phenomenal team! Wishing Orange Strategy nothing but success, growth, and prosperity 🧡🧩 

